import React from "react";
import BackToTop from "react-back-to-top-button";

const ToTopButton = () => {
  return (
    <div className="up-arrow">
      <BackToTop
        showOnScrollUp
        showAt={100}
        speed={1500}
        easing="easeInOutQuint"
      >
        <img sizes="small" src="./images/up-arrow.png" alt="up arrow"></img>
      </BackToTop>
    </div>
  );
};

export default ToTopButton;
